import './App.css';
import Carousel from './Carousel';

const elements = [
  {img: false, title: "1 title", text: "1 text"},
  {img: false, title: "2 title", text: "2 text"},
  {img: false, title: "3 title", text: "3 text"},
  {img: false, title: "4 title", text: "4 text"},
  {img: false, title: "5 title", text: "5 text"},
  {img: false, title: "6 title", text: "6 text"},
  {img: false, title: "7 title", text: "7 text"},
  {img: false, title: "8 title", text: "8 text"},
  {img: false, title: "9 title", text: "9 text"}
];

const settings = {
  style: {
    width: 400,
    height: 240
  },
  elemRender: 1,
  animation: "fade",
  seconds: 3500
};

function App() {
  return (
    <div className="App">
      <Carousel settings={settings} items={elements} />
    </div>
  );
}

export default App;
